"use client";
import cn from "@/lib/cn";
import { useState } from "react";
import { AnimatePresence, motion } from "framer-motion";
import Button from "@/elements/shared/button";
import { AnimateChangeInHeight } from "@/components/animate-change-in-height";

const SCREENS = [
  {
    title: "You best ideas deserve the best tools for your project",
    description:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem non augue nulla lectus. ",
  },
  {
    title: "we provide the best tools that you can rely on",
    description:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem non augue nulla lectus. ",
  },
  {
    title: "high availability/quality tools",
    description:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sem non augue nulla lectus. ",
  },
];

export default function OnBoardCard() {
  const [activeScreen, setActiveScreen] = useState(0);

  const isLastScreen = activeScreen === SCREENS.length - 1;

  const handleClick = () => {
    if (isLastScreen) return setActiveScreen(0);
    setActiveScreen(activeScreen + 1);
  };
  return (
    <div className="flex w-[267px] flex-col items-center gap-6 rounded bg-white px-4 py-6">
      <OnBoardSvg />

      {/* Dots */}
      <ul className="flex w-full justify-center gap-[11px]">
        {SCREENS.map((_, index) => (
          <li key={index}>
            <motion.button
              className={cn("size-[6px] rounded-full bg-[#E7EAEE]", {})}
              animate={{
                scale: activeScreen === index ? 1.6 : 1,
                backgroundColor: activeScreen === index ? "#064E3B" : "#E7EAEE",
                transition: { duration: 0.2, ease: "linear" },
              }}
              onClick={() => setActiveScreen(index)}
            ></motion.button>
          </li>
        ))}
      </ul>
      {/* Screens */}
      <AnimateChangeInHeight>
        <AnimatePresence initial={false} mode="wait">
          <motion.div
            key={activeScreen}
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            exit={{ opacity: 0 }}
          >
            <h2 className="text-center text-lg/6 font-semibold text-[#191D23]">
              {SCREENS[activeScreen]!.title}
            </h2>
            <p className="mt-2 text-center text-base/6 font-light text-[#191D23]">
              {SCREENS[activeScreen]!.description}
            </p>
          </motion.div>
        </AnimatePresence>
      </AnimateChangeInHeight>

      {/* Button */}
      <motion.div
        className="self-end"
        animate={{
          width: isLastScreen ? "100%" : "fit-content",
        }}
      >
        <Button
          className="flex items-center justify-center rounded-lg text-center"
          onClick={handleClick}
        >
          {isLastScreen ? "Get Started" : <NextIcon />}
        </Button>
      </motion.div>
    </div>
  );
}

